хм, я тебе назову пару причин, которые по моему опыту/мнению самые важные:
1) Нетворкинг - причина номер 1 из всех возможных причин;
2) Универ тебя учит 4 года и соответсвенно имеет возможность вбивать в тебя фундаментальные знания, которые курсы обходят стороной;
3) Текущие отношение нашего общества к универу. Вот честно, я более чем уверен, что без универа тебе будет закрыт доступ в 70% компаний

Привет, помогите пожалуйста 
Вот код, сейчас скину задание. 
 ответы выводит правильные, но вместе 15 он начинает писать бесконечное число "15", и так при любом ответе он его копирует бесконечно, я не поняла как записать while, что бы повторение ответа выключилось

A = int(input())
B = int(input()) 
while A >= 0 and B >= 0:
    if A > B and A % B == 0:
        print(A) 
    elif B > A and B % A == 0:
        print(B) 
    elif A == B:
        print(A)
    else:
        print(A * B)
